	<title>215 is</title>
	<style type="text/css">
		i {
			background: #dedede;
			float: left;
			width: 1em;
			height: 1em;
		}

		.mdown {
			background: red;
		}
		.clicked {
			background: blue;
		}
	</style>
	<script type="text/javascript">
	window.onload = function() {
		var els;

		function bind(obj, eventName, handler) {
			var handlerWrapper = function(event) {
					var event = event || window.event;
					if (event.srcElement) event.target = event.srcElement;
					return handler.call(obj, event);
				};

			if (obj.addEventListener) obj.addEventListener(eventName, handlerWrapper, false);
			else if (obj.attachEvent) obj.attachEvent('on' + eventName, handlerWrapper);
			return handlerWrapper;
		}

		bind(document.body, 'mousedown', function (event) {
			if (event.target.nodeName === 'I') {
				event.target.className = 'mdown';
			}
		});

		bind(document.body, 'click', function (event) {
			if (event.target.nodeName === 'I') {
				event.target.className = 'clicked';
			}
		});

		bind(document.body, 'mouseup', function (event) {
			if (event.target.nodeName === 'I') {
				event.target.className = 'mup';
			}
		});
	}
	</script>
